/*
 * This is the transfer size distribution table element.
 */
struct dist_entry
{
    unsigned int size_min;
    unsigned int size_max;
    unsigned int percent;
};

/*
 * This is the file size distribution table element.
 */
struct file_size_dist_entry
{
    unsigned long long size_min;
    unsigned long long size_max;
    unsigned int percent;
};

/*
 * Define the mix. In the future this will be read in from a file,
 * and is transported to all of the client processes.
 * Important:
 * We implicitly maintain a mapping through "union", this mapping should *NOT* be changes. 
			int percent_read;      <==> percent_cmdline_file_delete
			int percent_mmap_read; <==> percent_cmdline_file_download
			int percent_read_rand; <==> percent_cmdline_file_upload
			int percent_write;     <==> percent_cmdline_navigation
			int percent_mmap_write;<==> percent_explorer_file_download
			int percent_write_rand;<==> percent_explorer_file_upload
			int percent_rmw;       <==> percent_explorer_file_delete
			int percent_mkdir;     <==> percent_explorer_navigation
			int percent_rmdir;     <==> percent_explorer_navigation
			int percent_unlink;    <==> percent_explorer_select
			int percent_append;    <==> percent_word_edit_save
			int percent_locking;   <==> percent_word_file_open
			int percent_access;    <==> percent_word_file_close
 */
struct mix_table
{
    char workload_name[MAXWLNAME];
    union
    {
	struct
	{
	    int percent_read;
	    char read_string[OP_STR_LEN];
	    int percent_read_file;
	    char read_file_string[OP_STR_LEN];
	    int percent_mmap_read;
	    char mmap_read_string[OP_STR_LEN];
	    int percent_read_rand;
	    char read_rand_string[OP_STR_LEN];
	    int percent_write;
	    char write_string[OP_STR_LEN];
	    int percent_write_file;
	    char write_file_string[OP_STR_LEN];
	    int percent_mmap_write;
	    char mmap_write_string[OP_STR_LEN];
	    int percent_write_rand;
	    char write_rand_string[OP_STR_LEN];
	    int percent_rmw;
	    char rmw_string[OP_STR_LEN];
	    int percent_mkdir;
	    char mkdir_string[OP_STR_LEN];
	    int percent_rmdir;
	    char rmdir_string[OP_STR_LEN];
	    int percent_unlink;
	    char unlink_string[OP_STR_LEN];
	    int percent_unlink2;
	    char unlink2_string[OP_STR_LEN];
	    int percent_create;
	    char create_string[OP_STR_LEN];
	    int percent_append;
	    char append_string[OP_STR_LEN];
	    int percent_locking;
	    char locking_string[OP_STR_LEN];
	    int percent_access;
	    char access_string[OP_STR_LEN];
	    int percent_stat;
	    char stat_string[OP_STR_LEN];
	    int percent_neg_stat;
	    char neg_stat_string[OP_STR_LEN];
	    int percent_chmod;
	    char chmod_string[OP_STR_LEN];
	    int percent_readdir;
	    char readdir_string[OP_STR_LEN];
	    int percent_copyfile;
	    char copyfile_string[OP_STR_LEN];
	    int percent_rename;
	    char rename_string[OP_STR_LEN];
	    int percent_statfs;
	    char statfs_string[OP_STR_LEN];
	    int percent_pathconf;
	    char pathconf_string[OP_STR_LEN];
	    int percent_trunc;
	    char trunc_string[OP_STR_LEN];
	    int percent_custom1;
	    char custom1_string[OP_STR_LEN];
	    int percent_custom2;
	    char custom2_string[OP_STR_LEN];
	    struct dist_entry read_dist[MAX_DIST_ELEM];
	    struct dist_entry write_dist[MAX_DIST_ELEM];
	    struct file_size_dist_entry file_size_dist[MAX_DIST_ELEM];
	    int min_pre_name_length;
	    int max_pre_name_length;
	    int min_post_name_length;
	    int max_post_name_length;
	    int percent_commit;
	    int percent_direct;
	    int percent_fadvise_seq;
	    int percent_fadvise_rand;
	    int percent_fadvise_dont_need;
	    int percent_madvise_seq;
	    int percent_madvise_rand;
	    int percent_madvise_dont_need;
	    int align;
	    int percent_osync;
	    int percent_geometric;
	    int percent_compress;
	    int percent_dedup;
	    int percent_dedup_within;
	    int percent_dedup_across;
	    int dedup_group_count;
	    int percent_per_spot;
	    int min_acc_per_spot;
	    int acc_mult_spot;
	    int percent_affinity;
	    int spot_shape;
	    int dedup_granule_size;
	    int dedup_gran_rep_limit;
	    int use_file_size_dist;
	    int comp_granule_size;
	    int background;
	    int sharemode;
	    int rand_dist_behavior;
	    int uniform_file_size_dist;
	    int cipher;
	    int notify;
	    int lru_on;
	    int patt_vers;
	    int init_rate_enable;
	    float  init_rate_speed;
	    int init_read;
	    int shared_buckets;
	    int unlink2_no_recreate;
	    int extra_dir_levels;
	    int chaff_count;
	    int dir_count;
	    int instances;
	    float op_rate;
	    int files_per_dir;
	    int file_size;
	    int rel_version;
            /*---- below here is not included in check_sum ---*/
	    int warm_time;
	};
    };
    char platform_type[MAXFSNAME];
    char fs_type[MAXFSNAME];
};

